import React, {useState} from 'react'
import {SearchContainer} from '../styled.js'

const ToSearch = () => {
    const [text, setText] = useState('');

    const onChange = (e) => {
        setText(e.target.value);
    };


    return (
        <>
        <SearchContainer>
            <input onChange={onChange} val={text} placeholder="검색어를 입력 하세요"/>
            <button> 검색 </button>
            <div> {text} </div>
        </SearchContainer>

        </>

    )
}

export default ToSearch
